import React from 'react'

function NotFound() {
  return (
    <div className='container'>
        <h1>404 - Página no encontrada</h1>
      <p>Lo sentimos, pero la página que estás buscando no existe.</p>
      <p>Por favor, intente nuevamente.</p>
    </div>
  )
}

export default NotFound
